import React from 'react';

const Sports = () => {
    return (
        <div>
            <div>
                <h4 className="text-info">Try Now</h4>
                <h1>Winter Sports</h1>
            </div>
            <div>
                <iframe width="660" height="415" className="m-5" src="https://www.youtube.com/embed/xd39Ho1kfqc" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </div>
            <div>
                <Button
                    onClick={() => setOpen(!open)}
                    aria-controls="example-collapse-text"
                    aria-expanded={open}
                >
                    click
                </Button>
                <Collapse in={open}>
                    <div id="example-collapse-text">
                        Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus
                        terry richardson ad squid. Nihil anim keffiyeh helvetica, craft beer
                        labore wes anderson cred nesciunt sapiente ea proident.
                    </div>
                </Collapse>
                );
}

                render(<Example />);
            </div>
        </div>
    );
};

export default Sports;
